operations.content:
subscription CrdtAuthors($limit: Int!) {
  hasura_authors(limit: $limit, order_by: [{created_at: asc}, {id: asc}]) {
    __typename
    id
    name
    updated_at
    books(order_by: [{created_at: asc}, {id: asc}]) {
      __typename
      id
      title
      isbn
      updated_at
    }
  }
}

mutation CreateCrdt($crdt: hasura_crdt_insert_input!) {
  hasura_insert_crdt_one(object: $crdt) {
    __typename
    id
    guid
    client
    state
    vector
  }
}

query QueryClient($client: String!, $room: String!) {
  hasura_clients(where: {client: {_eq: $client}, crdt: {room: {_eq: $room}}}) {
    id
    vector
  }
}

query QueryCrdt($room: String!) {
  hasura_crdt(where: {room: {_eq: $room}}) {
    id
    __typename
    client
    guid
    state
    vector
  }
}

query QueryGetAuthors($limit: Int!) {
  hasura_authors(limit: $limit, order_by: {name: asc}) {
    __typename
    id
    name
    updated_at
    books(order_by: {title: desc}) {
      __typename
      id
      title
      isbn
      updated_at
    }
  }
}

query QueryGetBooks($limit: Int!) {
  hasura_books(limit: $limit, order_by: {title: asc}) {
    __typename
    id
    title
    isbn
    updated_at
    author {
      __typename
      id
      name
      updated_at
    }
  }
}

subscription SubscribeAuthors($limit: Int!) {
  hasura_authors(limit: $limit, order_by: [{created_at: asc}, {id: asc}]) {
    __typename
    id
    name
    updated_at
    books(order_by: [{created_at: asc}, {id: asc}]) {
      __typename
      id
      title
      isbn
      updated_at
    }
  }
}

subscription SubscribeBooks($limit: Int!) {
  hasura_books(limit: $limit, order_by: {title: asc}) {
    __typename
    id
    title
    isbn
    updated_at
    author {
      __typename
      id
      name
      updated_at
    }
  }
}

mutation UpdateAuthorName($id: String!, $name: String!) {
  hasura_update_authors_by_pk(pk_columns: {id: $id}, _set: {name: $name}) {
    id
  }
}

mutation UpdateBook($id: String!, $title: String!) {
  hasura_update_books_by_pk(pk_columns: {id: $id}, _set: {title: $title}) {
    id
  }
}

mutation UpdateCrdt($client: String!, $state: String!, $vector: String!) {
  hasura_update_crdt(
    where: {client: {_eq: $client}}
    _set: {state: $state, vector: $vector}
  ) {
    returning {
      id
    }
  }
}

mutation UpsertClient($client: hasura_clients_insert_input!) {
  hasura_insert_clients_one(
    object: $client
    on_conflict: {constraint: clients_client_unique, update_columns: [guid, vector]}
  ) {
    __typename
    id
    guid
    client
  }
}

mutation UpsertCrdt($client: String!, $crdt: hasura_crdt_set_input!) {
  hasura_update_crdt(where: {client: {_eq: $client}}, _set: $crdt) {
    returning {
      id
    }
  }
}

